import React, { Component } from 'react'

export default class part_three extends Component {
    render() {
        return (
            <div class="mp">
                <h1 class="text">Mobile Manufractrers</h1>
                <ul class="text">
                    <li>Sumsung</li>
                    <li>HTC</li>
                    <li>Xiaomi</li>
                    <li>Apple</li>
                </ul>
            </div>
        )
    }
}
